"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F10360984\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Akwa Tears&reg; [OTC];",
"     </li>",
"     <li>",
"      Refresh&reg; Lacri-Lube&reg; [OTC];",
"     </li>",
"     <li>",
"      Tears Renewed&reg; [OTC]",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F1049011\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Therapeutic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Lubricant, Ocular",
"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Ophthalmic Agent, Miscellaneous",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block don drugH1Div\" id=\"F12675256\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Neonatal",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     Neonatal data are unavailable. Dose extrapolated from older patients. Ophthalmic: Apply",
"     <sup>",
"      1",
"     </sup>",
"     /",
"     <sub>",
"      4",
"     </sub>",
"     &rdquo; of ointment to the inside of the lower lid as needed.",
"    </p>",
"   </div>",
"   <div class=\"block dos drugH1Div\" id=\"F1049008\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Usual",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Infants, Children, Adolescents, and Adults: Ophthalmic: Apply",
"     <sup>",
"      1",
"     </sup>",
"     /",
"     <sub>",
"      4",
"     </sub>",
"     &rdquo; of ointment to the inside of the lower lid as needed.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F245463\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.  [DSC] = Discontinued product",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ointment, ophthalmic:  (1 g [DSC], 3.5 g [DSC])",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Akwa Tears&reg;: 3.5 g (3.5 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ointment, ophthalmic [preservative free]:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Tears Renewed&reg;: 3.5 g (3.5 g)",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F1049014\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Ophthalmic: Do not use with contact lenses; to avoid contamination, do not touch tip of container to any surface",
"    </p>",
"   </div>",
"   <div class=\"block sta drugH1Div\" id=\"F1049010\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Stability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Store away from heat",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F1049013\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Ocular lubricant",
"    </p>",
"   </div>",
"   <div class=\"block arm drugH1Div\" id=\"F14198756\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Ocular: Temporary blurring of vision, irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F1049016\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to any component",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F1049007\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Discontinue if eye pain, vision change, redness or eye irritation occurs or if condition worsens or persists &gt;72 hours",
"    </p>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F1049006\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Forms an occlusive film on the surface of the eye to lubricate and protect the eye from drying",
"    </p>",
"   </div>",
"   <div class=\"block adi drugH1Div\" id=\"F1049017\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Additional Information",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Contains petrolatum, mineral oil, chlorobutanol and lanolin alcohols",
"    </p>",
"   </div>",
"  </div>",
