var title_f33_14_34018="Port placement for laparoscopic cholecystectomy";
var content_f33_14_34018=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F50974&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F50974&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 502px\">",
"   <div class=\"ttl\">",
"    Port placement for laparoscopic cholecystectomy*",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 482px; height: 586px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An open (Hasson) technique is used to enter the peritoneal cavity and place a 5 to 12 mm Hasson trocar at the umbilicus. The laparoscope is introduced through this port and three additional 5 mm ports are placed under direct vision 1 to 2 cm inferior to the right subcostal margin. The surgeon operates from the patient's left side using subxiphoid and typically the medial subcostal port (shown in red). The assistant works from patient's right side using the lateral subcostal port and periumbilical port (shown in blue).",
"    <br>",
"     <br>",
"      The surgeon manipulates the infundibulum of the gallbladder to provide counter-retraction with the left hand and uses a dissector with the right hand through the subxiphoid port. The assistant uses the left hand to retract the fundus superiorly and operates the camera with the right hand. The gallbladder is usually removed through the umbilical port.",
"      <div class=\"footnotes\">",
"       * Port placement and technique may vary amongst laparoscopic surgeons.",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
