var title_f33_14_34026="Pleural hematoma I CT";
var content_f33_14_34026=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F69148%7EPULM%2F56387%7EPULM%2F81933%7EPULM%2F60640&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F69148%7EPULM%2F56387%7EPULM%2F81933%7EPULM%2F60640&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Large pleural hematoma after trauma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 400px; height: 269px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CT scan performed without intravenous injection of contrast material shows inhomogeneous opacification of the right hemithorax with mostly higher attenuation material. A right-sided chest tube is in place. Cardiomediastinal shift to the left is seen. The interventricular cardiac septum is seen as a higher attenuation structure when compared to the interventricular blood. This suggests a severe dilutional anemia due to severe hemorrhage with a hemoglobin level of less than 7 g/dL.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pleural hematoma in right hemithorax",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 285px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Spontaneous hemorrhage in an anticoagulated patient. The right effusion has high attenuation due to the fresh blood. The left pleural effusion is transudative and has lower attenuation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Loculated pleural hematoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 342px; height: 326px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Loculated pleural hematoma in left hemithorax after CABG. The loculated collection of blood has higher attenuation than the chest wall musculature.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Infected pleural hematoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 333px; height: 339px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Loculated collection of blood with fresh thrombus exhibiting higher attenuation. Bubbles of gas are likely due to gas-forming organisms.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
