var title_f33_14_34027="Chronic migraine diagnostic criteria";
var content_f33_14_34027=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F56064&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F56064&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Revised International Headache Society criteria for chronic migraine",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        A. Headache (tension-type and/or migraine) on &ge;15 days per month for at least three months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Occurring in a patient who has had at least five attacks fulfilling criteria for migraine without aura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C. On &ge;8 days per month for at least three months, headache has fulfilled C1 and/or C2 below, that is, has fulfilled criteria for pain and associated symptoms of migraine without aura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        C1. Has at least two of the following",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        a) Unilateral location",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        b) Pulsating quality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        c) Moderate or severe pain intensity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        d) Aggravation by or causing avoidance of routine physical activity (eg, walking or climbing stairs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        and at least one of the following",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        e) Nausea and/or vomiting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        f) Photophobia and/or phonophobia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        C2. Treated and relieved by triptan(s) or ergot before the expected development of C1 above",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. No medication overuse and not attributed to another causative disorder",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Olesen J, Bousser MG, Diener HC, et al. New appendix criteria open for a broader concept of chronic migraine. Cephalalgia 2006; 26:742. Copyright &copy; 2006 Sage Publications. Reprinted by permission of Sage.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
